import React, { Component } from "react";

import "../../styles/LibraryResults.css";

import LibraryItem from "./libraryItem";

class LibraryResults extends Component {
  state = {
    queue: [
      {
        songTitle: "Ghost Voices",
        artist: "Virtual Self",
        albumImgURL: require("../../resources/images/GhostVoices.png"),
      },
      {
        songTitle: "Dosas and Mimosas",
        artist: "Cherub",
        albumImgURL: require("../../resources/images/DosasandMimosas.png"),
      },
    ],
  };
  render() {
    const { libraryPullResults } = this.props;

    var libraryPullResultsArray = [];
    for (var key in libraryPullResults) {
      libraryPullResultsArray.push(libraryPullResults[key]);
    }

    return (
      <div className="libraryDiv">
        {libraryPullResultsArray.map((item) => (
          <LibraryItem songInfo={item} />
        ))}
      </div>
    );
  }
}

export default LibraryResults;
